#include<string>
#include<iostream>
#include<vector>
using namespace std;

void findDifferentPosition(string &s, vector<int> &position, vector<int> &length)
{
	if (s == "")
		return;
		
	int size = s.size();
	char temp = s[0];
	position.push_back(0);

	for (int i = 1; i < size; ++i)
	{
		if (temp != s[i])
		{
			temp = s[i];
			position.push_back(i);
		}
	}

	int sizeVec = position.size();
	for (int i = 1; i < sizeVec; ++i)
	{
		length.push_back(position[i]-position[i-1]);
	}
	if (length.size() == 0)
		length.push_back(size);
	else
		length.push_back(size-position[sizeVec-1]);
}

int strStr(string haystack, string needle) 
{
	if (needle == "")
		return 0;
	if (haystack == "")
		return -1;
	
	vector<int> vecPosition0;
	vector<int> vecPosition1;
	vector<int> vecLength0;
	vector<int> vecLength1;
	findDifferentPosition(haystack, vecPosition0, vecLength0);
	findDifferentPosition(needle, vecPosition1, vecLength1);

	int position = -1;
	int size0 = vecPosition0.size();
	int size1 = vecPosition1.size();
	bool flag = false;

	for (int i = 0; i < size0 && flag == false && size0 - i >= size1; ++i)
	{
		for (int j = 0; j < size1 && flag == false; ++j)
		{
			if (haystack[vecPosition0[i + j]] != needle[vecPosition1[j]])
				break;

			int length0 = vecLength0[i + j];
			int length1 = vecLength1[j];

			if (length0 != length1)
			{
				//非头尾
				if (j != 0 && j != size1 - 1)
					break;
				//短了
				if (length0 < length1)
					break;
				//头部长了
				if (size1 > 1 && j == 0)
					vecPosition0[i] += (vecLength0[i] - vecLength1[0]);
			}

			if (j == size1 - 1)
			{
				flag = true;
				position = vecPosition0[i];
			}
		}
	}

	return position;
}


